INSERT INTO `cba_ant_messages` (`id`, `priority`, `start_date`, `end_date`, `viewed_date`, `viewed`, `title`, `description`, `html`, `url`, `language_code`, `date_modified`) VALUES ('abantecart_share_word', '1', '0000-00-00 00:00:00', '2030-01-01 00:00:00', '0000-00-00 00:00:00', '0', 'Help us making AbanteCart #1', '', '<p class="p1">Do you enjoy AbanteCart? See how you can help and contribute towards making AbanteCart even better.\r\n<strong><a href="http://www.abantecart.com/contribute-to-abantecart" target="_abantecart">Learn more</a></strong> </p>', '', '*', '2017-05-11 20:14:03');
INSERT INTO `cba_ant_messages` (`id`, `priority`, `start_date`, `end_date`, `viewed_date`, `viewed`, `title`, `description`, `html`, `url`, `language_code`, `date_modified`) VALUES ('capterra_review', '1', '0000-00-00 00:00:00', '2030-01-01 00:00:00', '0000-00-00 00:00:00', '0', 'Please review AbanteCart and share your experience', '', 'Do you like <strong>AbanteCart</strong>? Please rate AbanteCart or share your experience with other eCommerce entrepreneurs. Go to <strong><a href="http://www.capterra.com/ecommerce-software/spotlight/126413/AbanteCart/AbanteCart" target="_blank">Capterra rating page</a></strong> to add your rating or <strong><a href="http://www.capterra.com/ecommerce-software/reviews/126413/AbanteCart/AbanteCart/new" target="_blank">write a review</a></strong>', '', '*', '2017-05-11 20:14:03');
INSERT INTO `cba_ant_messages` (`id`, `priority`, `start_date`, `end_date`, `viewed_date`, `viewed`, `title`, `description`, `html`, `url`, `language_code`, `date_modified`) VALUES ('abantecart_hosting', '1', '0000-00-00 00:00:00', '2030-01-01 00:00:00', '0000-00-00 00:00:00', '0', 'Still looking for AbanteCart hosting', '', 'Do you need a hosting for your <strong>AbanteCart</strong>? Check hosting companies preselected for AbanteCart platform. Go to <strong><a href="http://www.abantecart.com/host-abantecart" target="_blank">hosting partners page</a></strong> to see what hosting provider will work best for your ecommerce ', '', '*', '2017-05-11 20:14:03');
INSERT INTO `cba_ant_messages` (`id`, `priority`, `start_date`, `end_date`, `viewed_date`, `viewed`, `title`, `description`, `html`, `url`, `language_code`, `date_modified`) VALUES ('banner', '1', '2011-09-16 06:54:47', '2030-01-01 00:00:00', '0000-00-00 00:00:00', '0', 'Banner at AbanteCart header', '', '<strong>AbanteCart</strong> V1.2.10 is a current application version. In AbanteCart 1.2.10 core code, database queries and cache are well optimized to deliver maximum performance and support high trafic.<strong><a href="http://www.abantecart.com/shopping-cart-news/abantecart-1210-released" target="_blank">Learn more ... </a></strong>', 'http://www.abantecart.com', '*', '2017-05-11 20:14:03');
