INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('73', '1', 'Highlighting Expressions', '', '', '&lt;p&gt;\r\n\tWHAT&lt;br /&gt;\r\n\tPantene Pro-V COLOUR HAIR SOLUTIONS Highlighting Expressions™ Conditioner protects and enhances colour treated hair and infuses blonde highlights with shine. The advanced Pro-Vitamin formula restores shine to dull highlights and protects hair from daily damage. This non-colour depositing formula works for all blonde highlights.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWHY&lt;br /&gt;\r\n\tPantene uncovered that oxidative colouring changes hair’s structure. Internally, the chemistry in hair colour attacks strength-giving proteins in hair and makes the fibre more porous, leading to weaker hair that fades more quickly. The surface of the hair fibres becomes uneven and the protective layer of the hair fibre disintegrates. Without the protective layer, the hair fibre is prone to micro-scarring and damage, which changes the way it interacts with light and leads to a dull appearance.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tHOW&lt;br /&gt;\r\n\tPantene’s non-colour depositing conditioner is designed to reinforce the structure of blonde highlighted hair and give it what it needs to reveal vibrant, glossy colour. Conditioning ingredients help revitalize and replenish highlighted hair while delivering brilliant shine and protecting from future damage. The result is healthy-looking hair rejuvenated with shimmering blonde highlights.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tUSE&lt;br /&gt;\r\n\tFor rich, vibrant colour that’s shiny and healthy-looking, use with Pantene Pro-V Pantene COLOUR HAIR SOLUTIONS Highlighting Expressions™ Shampoo and Colour Nourishing Treatment.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('74', '1', 'Curls to straight Shampoo', '', '', '&lt;p&gt;\r\n\tYOUR HAIR’S STARTING POINT&lt;br /&gt;\r\n\tCurly&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWHAT&lt;br /&gt;\r\n\tPantene Curly Hair Series Curls to Straight Shampoo gently removes build-up, adding softness and control to your curls. The cleansing formula helps align and smooth the hair fibers. The result is healthy-looking hair that’s protected from frizz and ready for straight styling.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWHY&lt;br /&gt;\r\n\tResearch shows that each curly hair fibre grows in a unique pattern, twisting and turning in all directions. This unpredictable pattern makes it difficult to create and control straight styles. The curved fibres of curly hair intersect with each other more often than any other hair type, causing friction which can result in breakage. The curvature of the hair fibre also provides a large amount of volume in curly hair, which can be hard to tame.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tHOW&lt;br /&gt;\r\n\tPantene’s straight shampoo contains micro-smoothers that aid you in loosening and unwinding curls from their natural pattern. Curly hair is left ready for frizz controlled straight styling, and protected from styling damage.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tUSE&lt;br /&gt;\r\n\tFor healthy-looking, curly hair that’s styled straight, use with Curls to Straight Conditioner and Anti-Frizz Straightening Crème.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('75', '1', 'Dove Men +Care Body Wash', '', '', '&lt;p&gt;\r\n\tA body and face wash developed for men\'s skin with Micromoisture technology.&lt;br /&gt;\r\n\tMicromoisture activates on skin when lathering up, clinically proven to fight skin dryness.&lt;br /&gt;\r\n\tDeep cleansing gel that rinses off easily. With purifying grains.&lt;br /&gt;\r\n\tDermatologist recommended.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('76', '1', 'Men+Care Clean Comfort Deodorant', '', '', '&lt;p&gt;\r\n        The first scented deodorant from Dove® specifically designed with a non-irritating formula to give men the power of 48-hour protection against underarm odor with advanced ¼ moisturizer technology. The bottom line? It’s tough on odor, not on skin&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('77', '1', 'Men+Care Active Clean Shower Tool', 'tool, man', '', '&lt;p&gt;\r\n\tDove® Men+CareTM Active Clean Dual-Sided Shower Tool works with body wash for extra scrubbing power you can’t get from just using your hands. The mesh side delivers the perfect amount of thick cleansing lather, and the scrub side helps exfoliate for a deeper clean. Easy to grip and easy to hang. For best results, replace every 4-6 weeks.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('78', '1', 'ck IN2U Eau De Toilette Spray for Him', '', '', '&lt;p&gt;\r\n\tFresh but warm; a tension that creates sexiness.Spontaneous - sexy - connectedCK IN2U him is a fresh woody oriental that penetrates with lime gin fizz and rushes into a combination of cool musks that radiate from top to bottom and leaves you wanting more.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('79', '1', 'ck One Gift Set', '', '', '&lt;p&gt;\r\n\t2 PC Gift Set includes 3.4 oz EDT Spray + Magnets. Ck One Cologne by Calvin Klein, Two bodies, two minds, and two souls are merged into the heat and passion of one. This erotic cologne combines man and woman with one provocative scent. This clean, refreshing fragrance has notes of bergamot, cardamom, pineapple, papaya, amber, and green tea.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('50', '1', 'Skinsheen Bronzer Stick', '', '', '&lt;p&gt;\r\n\tBronzes, shapes and sculpts the face. Sheer-to-medium buildable coverage that looks naturally radiant and sunny. Stashable - and with its M·A·C Surf, Baby look – way cool. Limited edition.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('51', '1', 'BeneFit Girl Meets Pearl', '', '', '&lt;p&gt;\r\n\tLuxurious liquid pearl…the perfect accessory! This soft golden pink liquid pearl glides on for a breathtakingly luminous complexion. Customise your pearlessence with the easy to use twist up package … a few clicks for a subtle sheen, more clicks for a whoa! glow. Pat the luminous liquid over make up or wear alone for dewy lit from within radiance. It\'s pure pearly pleasure. Raspberry and chamomile for soothing. Light reflecting pigments for exquisite radiance. Sweet almond seed for firming and smoothing. Sesame seed oil for moisturising.Fresh red raspberry scent.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('52', '1', 'Benefit Bella Bamba', '', '', '&lt;p&gt;\r\n\tAmplify cheekbones and create the illusion of sculpted features with this 3D watermelon blush. Laced with shimmering gold undertones, bellabamba is taking eye popping pretty to the third dimension…you’ll never use traditional blush again! Tip: For a poreless complexion that pops, sweep bellabamba on cheeks after applying porefessional&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('53', '1', 'Tropiques Minerale Loose Bronzer', '', '', '&lt;p&gt;\r\n\tPrecious earths, exclusively selected for their luxurious silky texture and gentle quality, are layered with mineral pigments in this lightweight powder to mimic the true color of tanned skin. Unique technology with inalterable earths ensures exquisite wear all day. Mineral blend smoothes complexion, while Aloe Vera helps protect skin from dryness.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('54', '1', 'L\'EXTRÊME Instant Extensions Lengthening Mascara', '', '', '&lt;p&gt;\r\n\tExtend your lashes up to 60% instantly! This exclusive Fibrestretch formula takes even the smallest natural lashes to dramatic lengths. The patented Extreme Lash brush attaches supple fibers to every eyelash for an instant lash extension effect.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('55', '1', 'LE ROUGE ABSOLU Reshaping &amp; Replenishing LipColour SPF 15', '', '', '&lt;p&gt;\r\n\tSmoother. Fuller. Absolutely replenished lips. This advanced lip color provides 6-hour care with continuous moisture and protective Vitamin E. Features plumping polymer and non-feathering color to define and reshape lips. Choose from an array of absolutely luxurious shades with a lustrous pearl or satin cream finish.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('56', '1', 'Waterproof Protective Undereye Concealer', '', '', '&lt;p&gt;\r\n\tThis natural coverage concealer lets you instantly eliminate tell-tale signs of stress and fatigue. Provides complete, natural-looking coverage, evens skin tone, covers dark circles and minimizes fine lines around the eyes. The Result: A soft, matte finish&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('57', '1', 'Delicate Oil-Free Powder Blush', '', '', '&lt;p&gt;\r\n\tA sparkling shimmer of colour for a radiant glow. Silky soft, micro-bubble formula glides on easily and evenly. Lasts for hours. Oil-free and oil-absorbing, yet moisture-balancing. Perfect for all skin types.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('58', '1', '&quot;hello flawless!&quot; custom powder foundation with SPF 15', '', '', '&lt;p&gt;\r\n\tThere are degrees of cover-up…some like less, some like more! Our blendable powder formula with SPF 15 goes on beautifully sheer &amp;amp; builds easily for customized coverage. Sweep on with the accompanying brush for a sheer, natural finish or apply with the sponge for full coverage or spot cover-up. Our 6 flattering shades (2 light, 2 medium, 2 deep) make it incredibly easy to find your perfect shade. Once gals apply &quot;hello flawless!&quot; they\'ll finally have met their match q!&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('59', '1', 'Viva Glam Lipstick', '', '', '&lt;p&gt;\r\n\tTime to wham up the GLAM in VIVA GLAM! It\'s a gaga-glamorous look at our abiding passion: The M·A·C AIDS Fund and the VIVA GLAM program are the heart and soul of M·A·C Cosmetics. Ladies and gentlemen, we give you the sensational Cyndi Lauper and the electric Lady Gaga&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('60', '1', 'Nail Lacquer', '', '', '&lt;p&gt;\r\n\tRevolutionary new high gloss formula. Three long-wearing finishes - Cream, Sheer, and Frosted. Visibly different. Provides no-streak/no-chip finish. Contains conditioners and UV protection. Go hi-lacquer!&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('61', '1', 'Color Design Eye Brightening All in One 5 Shadow &amp; Liner Palette', '', '', '&lt;p&gt;\r\n\tInfinitely luminous. Sensationally smooth. All-in-one 5 shadow palette to brighten eyes. Lancome’s new versatile, all-in-one palette conveniently creates a full eye look for day or night. Experience the newest generation of luminosity as silky lustrous powders transparently wrap the skin, allowing a seamless layering of pure color for a silky sheen and radiant finish. Build with absolute precision and apply the shades in 5 simple steps (all over, lid, crease, highlighter and liner) to design your customized eye look. Contour, sculpt and lift in soft day colors or intensify with dramatic evening hues for smoldering smoky effects. Long wear, 8-hour formula. Color does not fade, continues to stay true&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('62', '1', 'ck one shock for him Deodorant', '', '', '&lt;p&gt;\r\n\tShock Off! cK one shock for him opens with pure freshness, the heart pulses with spice and finishes with a masculine tobacco musk. Experience ck one shock, the newest fragrance from Calvin Klein with this 2.6 oz Deodorant.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('63', '1', 'Pour Homme Eau de Toilette', '', '', '&lt;p&gt;\r\n\tAn intriguing masculine fragrance that fuses the bracing freshness of Darjeeling tea with the intensity of spice and musk. For those seeking a discreet accent to their personality.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('64', '1', 'Beauty Eau de Parfum', '', '', '&lt;p&gt;\r\n\tBeauty by Calvin Klein is a sophisticated and feminine fragrance presenting a new scructure to modern florals. Radiating rich and intense luminosity; Beauty leaves a complex and memorable impression. Experience the glamour and strength with the Beauty Eau de Parfum&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('65', '1', 'Absolue Eye Precious Cells', '', '', '&lt;p&gt;\r\n\tSmoothes – Tightens – Regenerates Radiance Exclusive innovation from Lancôme A powerful combination of unique ingredients – Reconstruction Complex and Pro-Xylane™ – has been shown to improve the condition around the stem cells, and stimulate cell regeneration to reconstruct skin to a denser quality*. Results Immediately, the eye contour appears smoother and more radiant. Day 7, signs of fatigue are minimized and the appearance of puffiness is reduced. Day 28, density is improved. Skin is soft and looks healthier. The youthful look of the eye contour is restored. Ophthalmologist – tested. Dermatologist – tested for safety.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('66', '1', 'Total Moisture Facial Cream', '', '', '&lt;p&gt;\r\n\tSay good-bye to dry skin and hello to “total moisture”. This facial cream provides concentrated immediate &amp;amp; long-term hydration for an ultra radiant complexion. Contains exclusive tri-radiance complex to help develop the skin’s reserves of water &amp;amp; reinforce skin’s moisture barrier for a radiantly refreshed complexion. For normal to dry skin.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('67', '1', 'Flash Bronzer Body Gel', '', '', '&lt;p&gt;\r\n\tLook irresistible! Discover the self-tanning results you dream of: Instant bronzed glowing body Enriched with natural caramel extract for an immediate, gorgeous, bronzed glow. Exquisitely beautiful tan The perfect balance of self-tanning ingredients helps to achieve an ideal color, providing an even, natural-looking, golden tan. Color development within 30 minutes, lasting up to 5 days. Transfer-resistant formula With an exclusive Color-Set™ complex that smoothes on without streaks, dries in 4 minutes and protects clothes against rub-off. Hydrating &amp;amp; smoothing action Leaves skin soft, smooth, and hydrated. Pure Vitamin E delivers antioxidant protection, helping to reduce signs of premature aging. Indulgent experience Delightfully scented with hints of jasmine and honey in a silky, non-greasy formula&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('68', '1', 'Absolute Anti-Age Spot Replenishing Unifying TreatmentSPF 15', '', '', '&lt;p&gt;\r\n\tA luxurious and comprehensive hand treatment that addresses the special needs of mature hands. Diminishes and discourages the appearance of age spots, while replenishing and protecting the skin. RESULT: Immediately, skin on hands is hydrated, soft and luminous. With continued use, skin becomes more uniform, looks firmer and youthful.Massage into hands and cuticles as needed.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('69', '1', 'Seaweed Conditioner', '', '', '&lt;p&gt;\r\n\tWhat it is:&lt;br /&gt;\r\n\tA lightweight detangler made with marine seaweed and spirulina.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWhat it does:&lt;br /&gt;\r\n\tThis conditioner gently detangles, nourishes, softens, and helps to manage freshly washed hair.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWhat it is formulated WITHOUT:&lt;br /&gt;\r\n\t- Parabens&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWhat else you need to know:&lt;br /&gt;\r\n\tMade with marine greens for practically anyone (and ideal for frequent bathers), this conditioner is best paired with Seaweed Shampoo. It\'s also safe for use on color-treated hair.&lt;/p&gt;\r\n&lt;p&gt;\r\n\t-Sea Silk Extract: Nourishes scalp; promotes healthy looking hair.&lt;br /&gt;\r\n\t-Ascophyllum Nudosum (Seaweed) Extract: Moisturizes; adds elasticity, luster, softness, body; reduces flyaways.&lt;br /&gt;\r\n\t-Macrocystis Pyrifera (Sea Kelp) Extract: Adds shine and manageability.&lt;br /&gt;\r\n\t-Spirulina Maxima Extract: Hydrates.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('70', '1', 'Eau Parfumee au The Vert Shampoo', '', '', '&lt;p&gt;\r\n\tStructured around the refreshing vitality and purtiy of green tea, Bvlgari Eau the Vert Shampoo is an expression of elegance and personal indulgence. Delicately perfumed Eau Parfumée au thé vert shampoo gentle cleansing action makes it perfect for daily use.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('71', '1', 'Pantene Pro-V Conditioner, Classic Care', '', '', '&lt;p&gt;\r\n\tConditions hair for healthy shine. How Can You See Healthy Hair? Pantene Complete Therapy Conditioner has a unique pro-vitamin complex that deeply infuses every strand - So you see 6 signs of health hair: Shine; Softness; Strength; Body; Less Frizz; Silkiness. Pantene Complete Therapy Conditioner: The ultimate pro-vitamin therapy provides gentle daily nourishing moisture for enhanced shine; Helps hair detangle easily; Helps prevent frizz and flyaways. Simply use and in just 10 days - and very day after - see shiny hair that\'s soft with less frizz. Best of all, healthy Pantene hair that is strong and more resistant to damage. Made in USA.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('72', '1', 'Brunette expressions Conditioner', '', '', '&lt;p&gt;\r\n\tYOUR HAIR’S STARTING POINT&lt;br /&gt;\r\n\tColour-Treated or Highlighted&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWHAT&lt;br /&gt;\r\n\tPantene Pro-V COLOUR HAIR SOLUTIONS Brunette Expressions™ Conditioner hydrates hair for rich colour that is protected from daily stress and damage. This non-colour depositing formula works for all shades of brunette hair.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWHY&lt;br /&gt;\r\n\tPantene uncovered that oxidative colouring changes hair’s surface. Internally, the chemistry in hair colour attacks strength-giving proteins in hair and makes the fibre more porous, leading to weaker hair and that fades more quickly. The surface of the hair fibres then becomes uneven and the protective layer of the hair fibre disintegrates. Without the protective layer, the hair fibre is prone to micro-scarring and damage, which changes the way it interacts with light and leads to a dull appearance.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tHOW&lt;br /&gt;\r\n\tPantene’s advanced Pro-Vitamin formula enhances brunette colour for great intensity and radiant shine. Non-colour depositing conditioning ingredients enhance and protect colour treated hair, while helping to restore shine to coloured strands. Hair is moisturized and infused with radiant shine.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tUSE&lt;br /&gt;\r\n\tFor rich, vibrant colour that’s shiny and healthy-looking, use with Pantene Pro-V Pantene COLOUR HAIR SOLUTIONS Brunette Expressions™ Shampoo and Colour Nourishing Treatment.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('80', '1', 'Acqua Di Gio Pour Homme', '', '', '&lt;p&gt;\r\n\tA resolutely masculine fragrance born from the sea, the sun, the earth, and the breeze of a Mediterranean island. Transparent, aromatic, and woody in nature Aqua Di Gio Pour Homme is a contemporary expression of masculinity, in an aura of marine notes, fruits, herbs, and woods.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tNotes:&lt;br /&gt;\r\n\tMarine Notes, Mandarin, Bergamot, Neroli, Persimmon, Rosemary, Nasturtium, Jasmine, Amber, Patchouli, Cistus.&lt;br /&gt;\r\n\tStyle:&lt;br /&gt;\r\n\tTransparent, modern, and masculine.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('81', '1', 'Armani Eau de Toilette Spray ', '', '', '&lt;p&gt;\r\n\tThis confidently masculine embodiment of the sophisticated ease and understated elegance of Giorgio Armani fashions - is a simply tailored, yet intensely sensual combination of sparkling fresh fruits, robust spices, and rich wood notes.&lt;br /&gt;\r\n\tNotes:&lt;br /&gt;\r\n\tLime, Bergamot, Mandarin, Sweet Orange, Petitgrain, Cinnamon, Clove, Nutmeg, Jasmine, Neroli, Coriander, Lavender, Oakmoss, Sandalwood, Patchouli, Vetiver, Cedar.&lt;br /&gt;\r\n\tStyle:&lt;br /&gt;\r\n\tFresh, masculine, and discreet.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('82', '1', 'Armani Code after shave balm', '', '', '&lt;p&gt;\r\n\tSplash on this refreshing balm post-shave to soothe and calm the skin. Scents skin with a hint of seductive Code.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tIngredients&lt;br /&gt;\r\n\tAlcohol, Aqua/Water/Eau, Parfum/Fragrance, PEG 8, PEG 60 Hydrogenated Castor Oil, BHT, Allantoin (Comfrey Root), Linalool, Geraniol, Alpha Isomethyl Ionone, Coumarin, Limonene, Hydroxyisohexl 3 Cyclohexene Carboxaldehyde, Hydroxycitronellal, Citronellol, Citral, Butylphenyl Methlyproprional, Hexylcinnamal&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('83', '1', 'Armani Code Sport', '', '', '&lt;p&gt;\r\n\tSport. It\'s a rite of seduction. A vision of Giorgio Armani, translated into a fragrance.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tThis scent opens with an explosive freshness that features spearmint, peppermint, and wild mint—surprising and unusual top notes with a stunning effect. The citrusy heart of the fragrance reveals Code Sport\'s seductive power. Notes of vetiver from Haiti reveal a woody and distinguished character, at once wet and dry. Like a crisp coating of ice, a note of hivernal prolongs the dialogue between the scent\'s cool crispness and sensual breath, giving the fragrance an almost unlimited life.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tNotes:&lt;br /&gt;\r\n\tSpearmint, Peppermint, Wild Mint, Citrus, Hivernal, Hatian Vetiver, Nigerian Ginger.&lt;br /&gt;\r\n\tStyle:&lt;br /&gt;\r\n\tStunning. Cool. Seductive.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('84', '1', 'Armani Code Pour Femme', '', '', '&lt;p&gt;\r\n\tA seductive new fragrance for women, Armani Code Pour Femme is a fresh, sexy, feminine blend of zesty blood orange, ginger, and pear sorbet softened with hints of sambac jasmine, orange blossom, and lavender honey, warmed with precious woods and vanilla.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tNotes:&lt;br /&gt;\r\n\tBlood Orange, Ginger, Pear Sorbet, Sambac Jasmine, Orange Blossom, Seringa Flower, Lavender Honey, Precious Woods Complex, Vanilla.&lt;br /&gt;\r\n\tStyle:&lt;br /&gt;\r\n\tFresh. Sexy. Feminine.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('85', '1', 'Forbidden euphoria Eau de Parfum Spray ', '', '', '&lt;p&gt;\r\n\tPossessing an innate confidence and sophistication, she is just starting to explore her sexuality. What she doesn\'t yet know is that she already is every man\'s fantasy.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tA younger interpretation of Euphoria, this fruity floriental scent capitalizes on a modern, fresh sexiness with a mysterious twist. Its sparkling top notes seduce the senses with a blend of forbidden fruit such as mandarin, passion fruit, and iced raspberry. The heart blooms with a hypnotic bouquet of tiger orchid and jasmine. Underneath its exotic floralcy lies a layer of addictive patchouli and a sophisticated blend of musks and cashmere woods for an everlasting impression.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tNotes:&lt;br /&gt;\r\n\tSparkling Mandarin, Peach Blossom, Iced Raspberry, Pink Peony, Tiger Orchid, Jasmine, Cashmere Woods, Patchouli Absolute, Skin Musk.&lt;br /&gt;\r\n\tStyle:&lt;br /&gt;\r\n\tSophisticated. Confident. Forbidden.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('86', '1', 'Euphoria Men Intense Eau De Toilette Spray', '', '', '&lt;p&gt;\r\n\tLaunched by the design house of Calvin Klein in 2008, EUPHORIA MEN INTENSE is a men\'s fragrance that possesses a blend of Rain Water, Pepper, Ginger, Sage, Frosted Sudachi, Cedar leaf, Patchouli, Myrrh, Labdanum, Amber Solid, Vetiver&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('87', '1', 'MAN Eau de Toilette Spray', '', '', '&lt;p&gt;\r\n\tMan by Calvin Klein was launched in October of 2007 and proposed as a new classic for the modern Calvin Klein man, aged from 25 to 40. The name itself is programmatic and unambiguous, like an English translation of L\'Homme by Yves Saint Laurent. Simple, brief, to the point. You are going to smell the essence of masculinity if you are to take your cue from the name of the fragrance. The packaging is sleek, modernist, with an architectural sense of proportions and looks good. The fragrance was created by perfumers Jacques Cavallier and Harry Fremont from Firmenich in collaboration with consultant Ann Gottlieb. All these people are old hands at marketing successful mainstream fragrances. Man offers therefore a mainstream palatability but without coming across as depersonalized. It plays the distinctiveness card, but in a well reined in manner. The fragrance bears a typical masculine fresh aromatic, woody and spicy signature around the linear heart of the scent which itself is dark, fruity, and sweet enough to feel feminine. This rich amber-fruity accord is made even more seductive thanks to just the right amount of citrus-y counterpoint, which never clarifies the scent but on the contrary helps to deepen the dark fruity sensation.&lt;br /&gt;\r\n\t&nbsp;&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('88', '1', 'ck one Summer 3.4 oz', '', '', '&lt;p&gt;\r\n\tIt\'s a concert on a hot summer night. The stage is set and the show\'s about to start. Feel the breeze, catch the vibe, and move to the beat with the pulsating energy of this limited-edition fragrance. A unisex scent, it is fresh, clean, and easy to wear. The fragrance opens with a burst of crisp melon. In the heart notes, an invigorating blend of green citrus and the zesty herbaceous effect of verbena creates a cool, edgy freshness. A base of exotic incense and earthy oakmoss is wrapped in the light, sensuous warmth of cedarwood, musk, and peach skin. Notes:Tangerine, Water Fern, Melon, Lemon, Sea Breeze Accord, Blue Freesia, Verbena, Rhubarb, Cedarwood, Skin Musk, Incense, Peach Skin. Style:Invigorating. Crisp. Cool.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('89', '1', 'Secret Obsession Perfume', '', '', '&lt;p&gt;\r\n\tCalvin Klein Secret Obsession eau de parfum spray for women blends notes of forbidden fruits, exotic flowers and a sultry wood signature to create an intoxicating aroma that is provocative and addictive.Calvin Klein is one of World of Shops most popular brands, and this Calvin Klein Secret Obsession eau de parfum spray for women is a firm favourite amongst our customers for its deep, feminine aroma that is perfect for those special evenings out.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('90', '1', 'Obsession Night Perfume', '', '', '&lt;p&gt;\r\n\tLaunched by the design house of Calvin Klein in 2005, OBSESSION NIGHT is a women\'s fragrance that possesses a blend of gardenia, tonka bean, bergamot, vanilla, sandalwood, jasmine, rose, amber, muguet and mandarin. It is recommended for evening wear.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tIngredients&lt;br /&gt;\r\n\tNotes: Bergamot, Bitter Orange, Mandarin, White Floral, Angelica Root, Gardenia, Rose, Muguet, Night-Blooming Jasmine, Vanilla, Tonka Bean, Amber, Labdanum, Sandalwood, Cashmere Wood&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('91', '1', 'Jasmin Noir Body Lotion 6.8 fl oz', '', '', '&lt;p&gt;\r\n\tA bath collection for the body, scented with the Jasmin Noir fragrance. A tribute to ultimate femininity. Seduction and personal indulgence.&lt;br /&gt;\r\n\tBody Lotion Fragrance: The new emblematic creation within the Bvlgari Pour Femme Collection Jasmin Noir, perfectly embodies the luxury and prestige of Bvlgari fine jewelry.&lt;br /&gt;\r\n\tJasmin Noir is a flower of the imagination. Precious jasmine, white and immaculate, in its noire interpretation. A flower of pure mystery. A rich and delicate flower that at nightfall, reveals its intriguing sensuality. A precious floral woody fragrance with ambery accents centered around one of the true jewels of perfumery: the jasmin flower. A scent that conjures forth the bewildering seductiveness of feminity as elegant as it is profoundly sensual.&lt;br /&gt;\r\n\tJasmin Noir tells a voluptuous floral story that begins with the pure radiance of luminous light given by green and scintillating notes: Vegetal Sap and fresh Gardenia Petals. Then, tender and seductive, the Sambac Jasmine Absolute, delivers its generous and bewitching notes. Unexpectedly allied with a transparent silky almond accord, it reveals a heart that is light yet thoroughly exhilarating and marvelously addictive. The scent\'s sumptuously rich notes repose on a bed of Precious Wood and ambery undertones, bringing together the depth and mystery of Patchouli, the warmth of Tonka Bean and the comfort of silky Musks for an elegant and intimate sensuality.&lt;br /&gt;\r\n\tAn exquisite fragrance of incomparable prestige, Jasmin Noir captures the very essence of the jeweler.&lt;br /&gt;\r\n\tMade in Italy&lt;br /&gt;\r\n\t&nbsp;&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('92', '1', 'Body Cream by Bulgari', '', '', '&lt;p&gt;\r\n\tBVLGARI (Bulgari) by Bvlgari Body Cream 6.7 oz for Women Launched by the design house of Bvlgari in 1994, BVLGARI is classified as a refined, floral fragrance. This feminine scent possesses a blend of violet, orange blossom, and jasmine. Common spellings: Bulgari, Bvlgary, Bulgary.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('93', '1', 'Creme Precieuse Nuit 50ml', '', '', '&lt;p&gt;\r\n\tA luxurious, melting night cream to repair skin during sleep Features Polypeptides that boost production of collagen &amp;amp; elastin Improves skin elasticity &amp;amp; firmness Visibly reduces appearance of wrinkles, fine lines &amp;amp; brown spots Enriched with Bvlgari Gem Essence to restore radiance Skin appears smooth, energized &amp;amp; luminous in morning Perfect for all skin types&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('94', '1', 'Night Care Crema Nera Obsidian Mineral Complex', '', '', '&lt;p&gt;\r\n\tWhen it comes to body, skin or eye care, you want to look to our products and you will find the best there is. These are the most exceptional personal care products available. They meet the strictest standards for quality sourcing, environmental impact, results and safety. Our body care products truly allows you to be good to your whole body.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tGiorgio Armani - Cream Nera - Night Care Crema Nera Obsidian Mineral Complex3 Restoring Cream SPF 15 50ml/1.69oz A lavish, fresh &amp;amp; weightless anti-aging creamProvides shielding &amp;amp; moisturizing benefitsDeveloped with Obsidian Mineral Complex technology Formulated with iron, silicon &amp;amp; perlite to create a potent dermal restructuring system Contains Pro-XylaneTM &amp;amp; Hyaluronique Acid Targets loss of substance, sagging of features &amp;amp; deepening of wrinkles Reveals firmer, sleeker &amp;amp; plumper skin in a youthful look. With a fabulous Skincare product like this one, you\'ll be sure to enjoy the ultimate in a Skincare experience with promising results.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('95', '1', 'Skin Minerals For Men Cleansing Cream', '', '', '&lt;p&gt;\r\n\tUltra-purifying skincare enriched with essential moisturizing minerals, designed to instantly moisturize / purify the skin.&lt;br /&gt;\r\n\tActive Ingredients&lt;br /&gt;\r\n\t- Sodium and Potassium System: to preserve cutaneous hydration.&lt;br /&gt;\r\n\t- Salicylic Acid and Hamamelis Extract: to tighten the pores and tone skin.&lt;br /&gt;\r\n\tHigh Performances: the figures.&lt;br /&gt;\r\n\tSelf-assessment*:&lt;br /&gt;\r\n\t- leaves the skin clean 100%&lt;br /&gt;\r\n\t- leaves the skin comfortable 93%&lt;br /&gt;\r\n\t- leaves the skin smooth 95%&lt;br /&gt;\r\n\t- skin complexion is uniform 89%&lt;br /&gt;\r\n\t- skin texture is refined 80%&lt;br /&gt;\r\n\t* use test: 60 men 20 -65 years old 4 weeks of self-assessment&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('96', '1', 'Eye master', '', '', '&lt;p&gt;\r\n\tThe volcanic force of minerals concentrated in multi action skincare specifically designed to target wrinkles, bags and dark circles of the delicate eye area. To combat signs of aging and fatigue and visibly improve skin quality.&lt;br /&gt;\r\n\tActive Ingredients&lt;br /&gt;\r\n\t- Volcanic Complex: an innovative combination of energy charged minerals, inspired by volcanic rocks&lt;br /&gt;\r\n\t- Caffeine extract: to fight puffiness&lt;br /&gt;\r\n\t- Conker and butcher’s broom extracts to stimulate cutaneous blood micro-circulation&lt;br /&gt;\r\n\tHigh Performances: the figures.&lt;br /&gt;\r\n\tProven immediate anti-puffiness action*:&lt;br /&gt;\r\n\t- 15 minutes after application –19%&lt;br /&gt;\r\n\t*instrumental test, 40 men, 42-65 years old&lt;br /&gt;\r\n\tSelf-assessment&lt;br /&gt;\r\n\t- instantly revitalizes skin 77%**&lt;br /&gt;\r\n\t- wrinkles appear reduced 78%***&lt;br /&gt;\r\n\t- diminishes the appearance of dark circles 68%***&lt;br /&gt;\r\n\t** use test, 40 men 42-65 years old, single application, self-assessment&lt;br /&gt;\r\n\t*** use test, 40 men 42-65 years old, 4 weeks, self-assessment&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('97', '1', 'Eye Rejuvenating Serum', '', '', '&lt;p&gt;\r\n\tThe first advanced rejuvenating ‘weapon’ thanks to a corrective and smoothing texture and a power amplifying applicator.&lt;br /&gt;\r\n\tThe alliance of the [3.R] technology combined with an intensive re-smoothing system.&lt;br /&gt;\r\n\tThe eye rejuvenation serum also comes in an easily portable tube that boasts a silver bevelled applicator to ensure a good delivery of the product to the eye area as well as offering a means to improve circulation and reduce puffiness and eye bags.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tRarely women have been so convinced of its efficiency on skin rejuvenation:&lt;/p&gt;\r\n&lt;p&gt;\r\n\tEYE CONTOUR LOOKS SMOOTHER 85%*&lt;br /&gt;\r\n\tEYES LOOK YOUNGER 91%*&lt;br /&gt;\r\n\tEYE PUFFINESS LOOKS SOFTENED 83%*&lt;/p&gt;\r\n&lt;p&gt;\r\n\t*% of women – self assessment on 60 women after 4 weeks&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('98', '1', 'Shaving cream', '', '', '&lt;p&gt;\r\n\tMoisturizing, charged with minerals and enriched with ultra softening agents. Its specific formula ensures an optimal, extremely gentle shave. Even four hours after shaving, the skin remains hydrated, soft and supple.&lt;br /&gt;\r\n\tActive Ingredients&lt;br /&gt;\r\n\t- Sodium and Potassium System: to preserve cutaneous hydration&lt;br /&gt;\r\n\t- Bisabolol: to soothe skin&lt;br /&gt;\r\n\tHigh Performances: the figures.&lt;br /&gt;\r\n\tMeasurements 4 hours after shaving:&lt;br /&gt;\r\n\t- skin hydration +29%*&lt;br /&gt;\r\n\t- skin softness +61%**&lt;br /&gt;\r\n\t- skin suppleness +18%**&lt;br /&gt;\r\n\t- skin dryness -39%**&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;br /&gt;\r\n\t* instrumental test, 20 men, 20-70 years old&lt;br /&gt;\r\n\t** clinical scorage, 20 men, 20-70 years old&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('99', '1', 'Fluid shine nail polish', '', '', '&lt;p&gt;\r\n\tLuxurious color at your fingertips. Fluid shine coats nails with intense shine and long-lasting, sophisticated color. The essential accessory to any makeup wardrobe.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tDiscover the Bronze collection 2010&lt;br /&gt;\r\n\tFinish this season’s high summer look with a cranberry n°43 or blackberry n°44 nail, to echo the wet lips with intense color.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('100', '1', 'Smooth silk lip pencils', '', '', '&lt;p&gt;\r\n\tAn incredibly soft lip pencil for subtle, precise definition. The silky texture allows for easy application and flawless results. To extend the hold of your lip color, fill lips in completely with Smooth silk lip pencil before applying your lipstick. Choose from a wide range of shades to complement every color in your lipstick wardrobe.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('101', '1', 'Pro-V Color Hair Solutions Color Preserve Shine Conditioner', 'pantene, shampoo', '', '&lt;p&gt;\r\n\tPANTENE\'s color preserve shine shampoo and conditioner system with micro-polishers smoothes and refinishes the hair’s outer layer. So your hair reflects light and shines brilliantly. Help preserve your multi-dimensional color.&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Product Features&lt;/strong&gt;&lt;br /&gt;\r\n\tMicro-polishers smooth the outer layer of hair to help Protect color and leave hair shiny&lt;br /&gt;\r\n\tLightweight moisturizers provide protection against damage&lt;br /&gt;\r\n\tDesigned for color-treated hair; Gentle enough for permed hair&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Ingredients&lt;/strong&gt;&lt;br /&gt;\r\n\tWater, Stearyl Alcohol, Behentrimonium Methosulfate, Cetyl Alcohol, Fragrance, Bis-Aminopropyl Dimethicone, Isopropyl Alcohol, Benzyl Alcohol, Disodium EDTA, Panthenol, Panthenyl Ethyl Ether, Methylchloroisothiazolinone, Methylisothiazolinone&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&nbsp;&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('102', '1', 'Gucci Guilty', 'gicci, spray', '', '&lt;ul&gt;\r\n\t&lt;li&gt;\r\n\t\tNotes Consist Of Mandarin, Pink Pepper, Peach, Lilac, Geranium, Amber And Patchouli&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\tFor Casual Use&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n\t&lt;em&gt;Gucci Guilty&lt;/em&gt; is a warm yet striking oriental floral with hedonism at its heart.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tThe scent seizes the attention with a flamboyant opening born of the natural rush that is mandarin shimmering alongside an audacious fist of pink pepper.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tThe middle notes are an alluring concoction of heady lilac and geranium, laced with the succulent tactility of peach - all velvet femininity with a beguiling hint of provocation.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tThe patchouli that is the hallmark of Gucci fragrances here conveys a message of strength, while the voluptuousness of amber suggests deep femininity.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('103', '1', 'Jasmin Noir L\'Essence Eau de Parfum Spray 75ml', '', '', '&lt;p&gt;\r\n\tA carnal impression of the immaculate jasmine flower, Bvlgari Jasmin Noir L\'Essence dresses the purity of the bloom in jet black mystery.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tThe fragrance is a more concentrated Eau de Parfum than the original Jasmin Noir, a blend of rare and precious ingredients that are more seductive, and more addictive than ever before. The profoundly sensual elixir captivates the senses, and enchants its wearer with its generous and bewitching touches.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tA luminous bottle that honours the heritage of Bvlgari.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('104', '1', 'Calvin Klein Obsession For Women EDP Spray', '', '', '&lt;p&gt;\r\n\tCitrus, vanilla and greens lowering to notes of sandalwood, spices and musk. Recommended Use daytime&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;em&gt;\'Obsession\'&lt;/em&gt; perfume was launched by the design house of Calvin Klein in 1985&lt;/p&gt;\r\n&lt;p&gt;\r\n\tWhen you think about Calvin Klein, initially you think of his clothing line – specifically his jeans and underwear lines (not to mention the famous ad with a young Brooke Shields). But Calvin Klein’s penchant for perfume was equally as cutting edge as his foray into fashion.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('105', '1', 'Bvlgari Aqua', '', '', '&lt;p&gt;\r\n\tBvlgari Aqua (Pour Homme) Eau De Toilette Spray is an enticing and fresh cologne that exudes masculinity from its unique blend of amber santolina, posidonia and mandarin.&lt;/p&gt;\r\n&lt;p&gt;\r\n\tBvlgari Aqua (Pour Homme) Eau De Toilette Spray scent lasts throughout the day without having an overpowering smell. It is subtle enough for daytime use and masculine enough for night wear.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('106', '1', 'Omnia Eau de Toilette 65ml', 'bvlgary, omnia, EDT', '', '&lt;p&gt;\r\n\tChoose Your scent&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Omnia Coral:&lt;/strong&gt; Inspired by the shimmering hues of precious red coral, Omnia Coral is a radiant floral-fruity Eau de Toilette of tropical Hibiscus and juicy Pomegranate, reminiscent of Summer, the sun, resplendent nature and far-off oceans.&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Omnia Amethyst:&lt;/strong&gt; Inspired by the shimmering hues of the amethyst gemstone, this floral Eau de Toilette captures the myriad scents of Iris and Rose gardens caressed with morning dew.&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Omnia Crystalline:&lt;/strong&gt; Created from the glowing clarity and purity of crystal, Omnia Crystalline is a sparkling jewel of light, illuminating and reflecting the gentle sensuality and luminous femininity. Sparkling like a precious jewel, like the rarest of crystals, in an exquisite jewel flacon.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('107', '1', 'Lancome Slimissime 360 Slimming Activating Concentrate Unisex Treatment', '', '', '&lt;ul&gt;\r\n\t&lt;li&gt;\r\n\t\tAn anti-cellulite body treatment&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\tFeatures a special gel-cream texture &amp;amp; a quick-dissolving formula&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\tFormulated with an exclusive 360 Complex&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n\tAn anti-cellulite body treatment. Features a special gel-cream texture &amp;amp; a quick-dissolving formula. Formulated with an exclusive 360 Complex. Helps combat presence of cellulite &amp;amp; reduce existing cellulite. Provides immediate invigorating &amp;amp; firming results. Concentrated with micro-pearl particles to illuminate skin. Creates svelte &amp;amp; re-sculpted body contours....&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('108', '1', 'Lancome Hypnose Doll Lashes Mascara 4-Piece Gift Set', '', '', '&lt;p&gt;\r\n\t&nbsp;Lancome Hypnose Doll Lashes Mascara 4-Piece Gift Set! Limited Edition!&lt;/p&gt;\r\n&lt;ol&gt;\r\n\t&lt;li&gt;\r\n\t\t0.22 oz full-size Hypnôse Doll Lashes Mascara in Black&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\t0.07 oz full-size Le Crayon Khol Eyeliner in Black Ebony&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\t0.07 oz travel-size Cils Booster XL Super Enhancing Mascara Base&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\t1.7 fl oz travel-size Bi-Facil Double-Action Eye Makeup Remover&lt;/li&gt;\r\n&lt;/ol&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('109', '1', 'Lancome Visionnaire Advanced Skin Corrector', '', '', '&lt;p&gt;\r\n\tLancôme innovates with VISIONNAIRE [LR 2412 &nbsp;4%], its ?rst&nbsp;skincare product formulated to fundamentally recreate truly&nbsp;beautiful skin.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tA Lancôme technological breakthrough has identi?ed&nbsp;a miraculous new molecule.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tThe name of this molecule: LR 2412.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tA molecule that is able to “self-propel” through the layers&nbsp;of the epidermis, to set off a series of tissular micro-transformations.&nbsp;The result is that skin is visibly transformed: the texture is ?ner,&nbsp;wrinkles are erased, pigmentary and vascular irregularities are&nbsp;reduced and pores are tightened.&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;em&gt;Download Presentation file after order.&lt;/em&gt;&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('110', '1', 'Flora By Gucci Eau Fraiche', '', '', '&lt;ul&gt;\r\n\t&lt;li&gt;\r\n\t\tPerfect for all occasions&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\tThis item is not a tester; New and sealed&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t\tContains natural ingredients&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n\tGucci presents the new spring version of this perfume called flora by Gucci eau fraiche in 2011. Even younger, more airy, vivid, sparkling and fresher than the original, the new fragrance is enriched with additional aromas of citruses in the top notes and aquatic and green nuances in the heart, while the base remains unchanged. The composition begins with mandarin, bergamot, kumquat, lemon and peony. The heart is made of rose petals and Osman thus with green and aquatic additions, laid on the base of sandalwood, patchouli and pink pepper.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('111', '1', 'New French With Ease (1 book + 1 mp3 CD)', '', '', 'This title is available in book and CD. All Assimil courses are based on intuitive assimilations[registered], an original principle that is simple yet highly effective. Assimil has taken this natural process, through which you learned to speak your own language, and adapted it to their book and audio courses. Working progressively, with natural, lively dialogues, simple text notes and exercises, you will progress steadily to a level where you are able to converse in everyday situations. The first part of the course is the passive phase: you immerse yourself in the language by reading and repeating each lesson. During the second, the active phase, you use the structures and reflexes you have already absorbed while continuing to advance and learn. In just a few months, you will be able to speak French easily, fluently and naturally.&lt;br /&gt;\r\n&amp;nbsp;\r\n&lt;ul style=&quot;color: rgb(51, 51, 51); padding: 0px; list-style-type: none; font-size: 13px; font-family: verdana, arial, helvetica, sans-serif; line-height: 19px; orphans: auto; text-align: start; text-indent: 0px;&quot;&gt;\r\n\t&lt;li&gt;Audio CD: 610 pages&lt;/li&gt;\r\n\t&lt;li&gt;Publisher: ASSiMiL (3 April 2008)&lt;/li&gt;\r\n\t&lt;li&gt;Language: English&lt;/li&gt;\r\n\t&lt;li&gt;ISBN-10: 2700570057&lt;/li&gt;\r\n\t&lt;li&gt;ISBN-13: 978-2700570052&lt;/li&gt;\r\n\t&lt;li&gt;Product Dimensions: 23.6 x 17.8 x 5.1 cm&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('112', '1', 'The Miracle Morning: The Not-So-Obvious Secret Guaranteed to Transform Your Life', '', '', 'What if you could miraculously wake up tomorrow and any&amp;mdash;or every area of your life was transformed? What would be different? Would you be happier? Healthier? More successful? In better shape? Would you have more energy? Less Stress? More Money? Better relationships? Which of your problems would be solved?&lt;br /&gt;\r\n&amp;nbsp;\r\n&lt;ul style=&quot;color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal;&quot;&gt;\r\n\t&lt;li&gt;&lt;b style=&quot;font-weight: 700; font-family: verdana, arial, helvetica, sans-serif;&quot;&gt;Print Length:&lt;/b&gt; 172 pages&lt;/li&gt;\r\n\t&lt;li&gt;&lt;b style=&quot;font-weight: 700; font-family: verdana, arial, helvetica, sans-serif;&quot;&gt;Page Numbers Source ISBN:&lt;/b&gt; 0979019710&lt;/li&gt;\r\n\t&lt;li&gt;&lt;b style=&quot;font-weight: 700; font-family: verdana, arial, helvetica, sans-serif;&quot;&gt;Publication Date:&lt;/b&gt; December 7, 2012&lt;/li&gt;\r\n\t&lt;li&gt;&lt;b style=&quot;font-weight: 700; font-family: verdana, arial, helvetica, sans-serif;&quot;&gt;Language:&lt;/b&gt; English&lt;/li&gt;\r\n\t&lt;li&gt;&lt;b style=&quot;font-weight: 700; font-family: verdana, arial, helvetica, sans-serif;&quot;&gt;ASIN:&lt;/b&gt; B00AKKS278&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;hr /&gt;\r\nAbout the Author\r\n&lt;p&gt;At age 20, Hal Elrod was hit head on by a drunk driver at 70 mph, was dead for 6 minutes, and doctors told his parents that if Hal ever came out of his coma, he had permanent brain damage and may never walk again. After 6 days of fighting for his life, Hal proved that we all have the ability to overcome any obstacle and create the life of our dreams. Not only did he walk, he became an ultra-marathon runner, hall of fame business achiever, international Keynote Speaker, Success Coach, husband, father, hip-hop recording artist, and multiple time #1 bestselling author of &amp;quot;The Miracle Morning: The Not-So-Obvious Secret Guaranteed To Transform Your Life... (Before 8AM)&amp;quot; and &amp;quot;Taking Life Head On: How To Love the Life You Have While You Create the Life of Your Dreams&amp;quot;&amp;mdash;two of the highest rated and most acclaimed books on Amazon.com. (Just read a few of the 200+ five-star reviews, and you&amp;rsquo;ll see why.) Hal has appeared on dozens of radio and TV shows, and he&amp;rsquo;s been featured in numerous books, including The Education of Millionaires, Cutting Edge Sales, Living College Life in the Front Row, The Author&amp;rsquo;s Guide To Building An Online Platform, The 800-Pound Gorilla of Sales and the bestselling Chicken Soup for the Soul series. To contact Hal about media appearances, speaking at your event, or if you just want to receive free training videos and resources, visit www.YoPalHal.com. To connect with Hal on Twitter, follow @HalElrod, and on Facebook at www.Facebook.com/YoPalHal.&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('113', '1', 'Paper Towns by John Green', '', '', '&lt;strong&gt;Winner of the Edgar Award&lt;br /&gt;\r\nThe #1 New York Times Bestseller&lt;br /&gt;\r\nPublishers Weekly and USA Today Bestseller&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;em&gt;Millions of Copies Sold&lt;/em&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nQuentin Jacobsen has spent a lifetime loving the magnificent Margo Roth Spiegelman from afar. So when she cracks open a window and climbs back into his life&amp;mdash;summoning him for an ingenious campaign of revenge&amp;mdash;he follows. When their all-nighter ends and a new day breaks, Margo has disappeared. But Q soon learns that there are clues&amp;mdash;and they&amp;rsquo;re for him. Embarking on an exhilarating adventure to find her, the closer Q gets, the less he sees the girl he thought he knew.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOctober 2008&lt;br /&gt;\r\n352 pages&lt;br /&gt;\r\nISBN 9781101010938&lt;br /&gt;\r\nTitle: Paper Towns&lt;br /&gt;\r\nAuthor: John Green', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('114', '1', 'Allegiant by Veronica Roth', '', '', 'Now includes an excerpt from the upcoming Four: A Divergent Collection.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhat if your whole world was a lie? What if a single revelation&amp;mdash;like a single choice&amp;mdash;changed everything? What if love and loyalty made you do things you never expected?&lt;br /&gt;\r\nThe explosive conclusion to Veronica Roth&amp;#39;s #1 New York Times bestselling Divergent trilogy reveals the secrets of the dystopian world that has captivated millions of readers in &lt;em&gt;Divergent&lt;/em&gt; and &lt;em&gt;Insurgent&lt;/em&gt;.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOctober 2013&lt;br /&gt;\r\n544 pages&lt;br /&gt;\r\nISBN 9780062209276&lt;br /&gt;\r\nTitle: Allegiant&lt;br /&gt;\r\nAuthor: Veronica Roth', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('115', '1', 'Fiorella Purple Peep Toes', '', '', 'Add more charm to your casual footwear collection with these purple peep toes from the house of Fiorella. Featuring a non-leather upper and lining, these slip-ons ate high on durability and style. While the wedge heels add extra inches to your silhouette, the resin sole ensures optimal traction for your feet. Team these peep toes with your casual outfits to complete your look for the day.&lt;br /&gt;\r\n&lt;br /&gt;\r\nSole Material&amp;nbsp; &lt;strong&gt;Resin Sheet&lt;/strong&gt;&lt;br /&gt;\r\nInner Lining&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;strong&gt;SYNTHETIC&lt;/strong&gt;&lt;br /&gt;\r\nClosing&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;strong&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; Slip On&lt;/strong&gt;&lt;br /&gt;\r\nHeel shape&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;strong&gt;Wedge&lt;/strong&gt;&lt;br /&gt;\r\nHeel height&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;strong&gt; Medium: 2.5-3.5 Inch&lt;/strong&gt;\r\n&lt;hr /&gt;&amp;nbsp;\r\n&lt;table style=&quot;margin: 0px; padding: 0px; width: 385px; color: rgb(34, 34, 34); font-family: Arial; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);&quot;&gt;\r\n\t&lt;tbody style=&quot;margin: 0px; padding: 0px;&quot;&gt;\r\n\t\t&lt;tr style=&quot;margin: 0px; padding: 0px;&quot;&gt;\r\n\t\t\t&lt;th style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap;&quot;&gt;Euro Size&lt;/th&gt;\r\n\t\t\t&lt;th style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap;&quot;&gt;UK Size&lt;/th&gt;\r\n\t\t\t&lt;th style=&quo