lign: center; white-space: nowrap;&quot;&gt;39&lt;/td&gt;\r\n\t\t\t&lt;td style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap;&quot;&gt;6&lt;/td&gt;\r\n\t\t\t&lt;td style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap;&quot;&gt;24.8-25.2&lt;/td&gt;\r\n\t\t&lt;/tr&gt;\r\n\t\t&lt;tr class=&quot;even&quot; style=&quot;margin: 0px; padding: 0px;&quot;&gt;\r\n\t\t\t&lt;td class=&quot;f-bold&quot; style=&quot;margin: 0px; padding: 7px; font-weight: bold; text-align: center; white-space: nowrap; background: rgb(238, 238, 238);&quot;&gt;40&lt;/td&gt;\r\n\t\t\t&lt;td style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap; background: rgb(238, 238, 238);&quot;&gt;6.5&lt;/td&gt;\r\n\t\t\t&lt;td style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap; background: rgb(238, 238, 238);&quot;&gt;25.4-25.7&lt;/td&gt;\r\n\t\t&lt;/tr&gt;\r\n\t\t&lt;tr style=&quot;margin: 0px; padding: 0px;&quot;&gt;\r\n\t\t\t&lt;td class=&quot;f-bold&quot; style=&quot;margin: 0px; padding: 7px; font-weight: bold; text-align: center; white-space: nowrap;&quot;&gt;41&lt;/td&gt;\r\n\t\t\t&lt;td style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap;&quot;&gt;7&lt;/td&gt;\r\n\t\t\t&lt;td style=&quot;margin: 0px; padding: 7px; text-align: center; white-space: nowrap;&quot;&gt;26.0-26.4&lt;/td&gt;\r\n\t\t&lt;/tr&gt;\r\n\t&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('116', '1', 'New Ladies High Wedge Heel Toe Thong Diamante Flip Flop Sandals', '', '', '&lt;p&gt;The annual Summer trend for wedges is back with these classic flip flop wedge heels. The sandals have a toe thong design, diamante detailing to the front and look fab worn with a maxi dress for a classic Summer look. Available in a choice of five different colours.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li&gt;Available in 5 different colours&lt;/li&gt;\r\n\t&lt;li&gt;Diamante detailing to the front&lt;/li&gt;\r\n\t&lt;li&gt;Outer Material: &lt;em&gt;Synthetic&lt;/em&gt;&lt;/li&gt;\r\n\t&lt;li&gt;Inner Material: &lt;em&gt;Manmade&lt;/em&gt;&lt;/li&gt;\r\n\t&lt;li&gt;Heel Height: &lt;em&gt;9.5 centimetres&lt;/em&gt;&lt;/li&gt;\r\n\t&lt;li&gt;Heel Type: Wedge&lt;/li&gt;\r\n\t&lt;li&gt;Sandals have a toe thong design&lt;/li&gt;\r\n\t&lt;li&gt;Classic flip flop wedge heels&lt;/li&gt;\r\n\t&lt;li&gt;&lt;strong&gt;Perfect for the Summer!&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('117', '1', 'Ruby Shoo Womens Jada T-Bar', '', '', '&lt;p&gt;Ruby Shoo is made up of a small team based in north London, England, with a passion for creating unique shoes and accessories that generate smiles whenever they are worn. We simply love it when we are asked the question: &amp;quot;Where did you get your shoes?&amp;quot;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Occasion footwear&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Flower detail&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Outer Material: Synthetic&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Inner Material: Manmade&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Sole: Manmade&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Closure: Buckle&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Heel Height: 9 centimetres&lt;/li&gt;\r\n\t&lt;li style=&quot;list-style-type: square; margin-left: 20px;&quot;&gt;Heel Type: Stiletto&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('118', '1', 'Womens high heel point toe stiletto sandals ankle strap court shoes', '', '', '&lt;p&gt;Fashion Thirsty&amp;reg; branded products are only available exclusively through Fashion Thirsty&lt;/p&gt;\r\n&lt;ul&gt;\r\n\t&lt;li&gt;Brand New In Box&lt;/li&gt;\r\n\t&lt;li&gt;Available In A Range Of Colours And Fabrics&lt;/li&gt;\r\n\t&lt;li&gt;Outer Material: Synthetic&lt;/li&gt;\r\n\t&lt;li&gt;Inner Material: Manmade&lt;/li&gt;\r\n\t&lt;li&gt;Sole: manmade&lt;/li&gt;\r\n\t&lt;li&gt;Closure: Buckle&lt;/li&gt;\r\n\t&lt;li&gt;Heel Height: 4.3&lt;/li&gt;\r\n\t&lt;li&gt;Heel Type: Stiletto&lt;/li&gt;\r\n\t&lt;li&gt;Approx Heel Height: 4.3 Inches / 10.8 cm&lt;/li&gt;\r\n\t&lt;li&gt;Approx Platform Height: 0.1 inches / 0.3 cm&lt;/li&gt;\r\n\t&lt;li&gt;Ankle Strap With Buckle Fastening&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('119', '1', 'Fruit of the Loom T-Shirts 5 Pack - Super Premium', '', '', '5x Fruit of the Loom T-Shirt Super Premium T&lt;br /&gt;\r\n10 Colors - Sizes: S, M, L, XL, XXL oder XXXL\r\n&lt;hr /&gt;The purchase of this 5-packs, you have the following choice:&lt;br /&gt;\r\n&amp;bull; 5 of the same color t-shirts (available in 18 colors)&lt;br /&gt;\r\n&amp;bull; 5 different colored T-shirts (given in 8 color sets available)&lt;br /&gt;\r\nYou have the freedom to choose from the adult sizes S, M, L, XL, XXL or XXXL.', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('120', '1', 'Jersey Cotton Striped Polo Shirt', '', 't-shirs, men', '&lt;p&gt;Classically designed Charles Wilson polo shirts now available.&lt;br /&gt;\r\nThis premium polo collection is a result of many years experience in designing and manufacturing polo shirts.&lt;br /&gt;\r\nPart of our Jersey Stripe polo range this colourful jersey cotton polo shirt is a must have piece for any casual wardrobe.&lt;br /&gt;\r\nDesigned in the UK&lt;br /&gt;\r\n100% Cotton&lt;br /&gt;\r\nJersey Stripe Polo&lt;br /&gt;\r\nMulti-Stripe Design&lt;br /&gt;\r\nThree Button Design&lt;br /&gt;\r\nMachine Washable at 40 Degrees&lt;/p&gt;\r\n', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('121', '1', 'Designer Men Casual Formal Double Cuffs Grandad Band Collar Shirt Elegant Tie', '', '', 'Superb style double cuffs shirt. Made using highest quality cotton. Grandad collar. Slim Fit. Highest quality - made in Turkey. Great as casual or formal shirt.', '');
INSERT INTO `cba_product_descriptions` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`, `blurb`) VALUES ('122', '1', 'Mens Fine Cotton Giraffe Polo Shirts', '', '', 'Designed by slim fit style FOR men and women in highest qualities and workmanship to bring buyers A different outlook on life of fashion Casual Basic Slim Fit Polo Shirts\r\n&lt;ul&gt;\r\n\t&lt;li&gt;100% COTTON&lt;/li&gt;\r\n\t&lt;li&gt;If you buy these Polo shits, You&amp;#39;ll never regret about purchase. Because it is so nice designed shirts for your daily look.&lt;/li&gt;\r\n\t&lt;li&gt;Soft Elastic Decent slim fit &amp;amp; Button placket &amp;amp; sleeve ribbing with contrast trim.&lt;/li&gt;\r\n\t&lt;li&gt;Machine Wash / Hand Wash Recommended&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '');
