INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('63', '77', '6', 'Bernard Horne', 'I thought since it was made for men that it was the perfect thing to go with the body wash. Its too small and doesn\'t lather up very well.', '3', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('62', '54', '2', 'Juliana Davis', 'I\'ve been wearing all Lancome mascara\'s and I\'m just get really upset when I\'m out. I\'ve tried other Brands, but it\'s always right back to the Lancome productss. The extend L\'EXTREME is by far the best!!! Really Long and Great! ', '5', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('61', '56', '0', 'Cassandra', 'Fortunately, I got this as a gift. BUT, I am willing to purchase this when I run out. This may be expensive but it is sooooo worth it! I love this concealer and I wouldn\'t even dare to use other brands. One more thing, the little tube lasts for a long time. I\'ve been using it everyday for 8 months now and I still have about 1/4 left.', '5', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('64', '76', '7', 'James', 'Finally a deodorant for men that doesn\'t smell like cheap cologne. I\'ve been using this for a couple of weeks now and I can\'t say anything bad about it. To me it just smells fresh', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('65', '100', '0', 'Juli', 'Smooth Silk is an accurate name for this creamy lip liner. It is by far the best lip pencil I have ever encountered.', '5', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('66', '100', '0', 'Marianne', 'Nice pencil! This is a smooth, long lasting pencil, wonderful shades!', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('67', '97', '0', 'Ann', 'Really reduces shades and swellings)', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('68', '99', '0', 'Alice', 'This is much darker than the picture', '2', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('69', '57', '0', 'Jane', 'When it arrived, the blush had cracked and was crumbling all over, so I\'m only able to use half of it.', '2', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('70', '55', '0', 'Kristin K.', 'These lipsticks are moisturizing and have good pigmentation; however, their lasting power is not as advertised! ', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('71', '55', '0', 'lara', 'This is quite simply good stuff. \nThe color payout is rich, the texture creamy and moist, and best of all no scent. No taste.', '5', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('72', '93', '0', 'L. D.', 'I totally love it.it smells heavenly . It smells so natural and my skin just loves it. ', '5', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('73', '93', '0', 'Walton', 'This creme is a bit heavy for my skin; however, as the day goes on it does not create an oily build-up. A little goes a long way, and I could see improvements in my skin tone within a week. Good product, will be purchasing again.', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('74', '74', '0', 'Stefania V', 'it works very well moisturing and cleaning and unlike many other healthy shampoos it doesn\'t open the hair platelets too far and therefore doesn\'t feel so dry and sticky so I can get away without using a conditioner. Great value.', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('75', '102', '0', 'Mary', 'This is more of a evening fragrance. I love it', '4', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('76', '110', '0', 'Lara', 'Product was very reasonably priced. It will make a nice gift.', '5', '1', '2015-06-12 09:56:25', '2015-06-12 09:56:25');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('77', '111', '0', 'Mr. G. Thomas', 'I would totally recommend product for anyone keen to learn a foreign language quickly. \nHowever, you must be fully committed and be ready to dedicate your time for study every day!', '5', '1', '2015-06-12 10:45:59', '2015-06-12 10:52:03');
INSERT INTO `cba_reviews` (`review_id`, `product_id`, `customer_id`, `author`, `text`, `rating`, `status`, `date_added`, `date_modified`) VALUES ('78', '119', '0', 'F Buckley ', 'Good quality. Also good enough to wear out.\n\nWould order more in the future. ', '5', '1', '2015-06-22 10:27:59', '2015-06-22 10:28:13');
